import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Navbar from "./Navbar";
import { ThemeProvider } from '@material-ui/core'
import PhotoCard from './PhotoCard';
import Grid from '@material-ui/core/Grid';
import Footer from "./Footer";
import bodyTheme from './themes/bodyTheme'


const useStyles = makeStyles((theme) => ({
    root: {
        height: "100vh",
        width: "100%",
        overflow: "auto",
    },
    navbar: {
        background: "#0a1338", // Primary Navy
    },
    title: {
        paddingTop: "calc(40px + 3vh)",
        paddingBottom: "calc(40px + 3vh)",
        fontSize: "calc(26px + 1.6vw)",
        //color: "#0a1338",
        color: "#3f4047",
        fontWeight: "600",
        textAlign: "center",
        fontFamily: "barlow",
        backgroundColor: "white",
    },
    container: {
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        paddingRight: "5vw",
        paddingLeft: "5vw",
        paddingBottom: "2vw",
        paddingTop: "6vh",
        backgroundColor: "white",
    }, 
})
)
export default function Photography() {
    const classes = useStyles();
  return (
    <ThemeProvider theme={bodyTheme}> 
        <div className={classes.root}>
            <div className={classes.navbar}>
                <Navbar/>
            </div>
            <div className={classes.title}>
                Analog Captures
                <div className={classes.container}>
                    <Grid container justify="center" alignItems="center" spacing={0}>
                        <Grid item xs={12} sm={9} justify="center" alignItems="center">
                            <PhotoCard photoNumber="1" name="Bondi Skate Club"/>
                        </Grid>
                        <Grid item>
                            < Grid container justify="center" alignItems="center" spacing ={0}>
                                <Grid item xs={12} sm={3} justify="center" alignItems="center">
                                    <PhotoCard photoNumber="2" name="Gem of the Ocean"/>
                                </Grid>
                                <Grid item xs={12} sm={6} justify="center" alignItems="center">
                                    <PhotoCard photoNumber="3" name="The Icebergs"/>
                            </Grid>
                        </Grid>


                        </Grid>

                    </Grid>
                </div>
            </div>
            <Footer/>
        </div>
    </ThemeProvider>
  );
}
